import React, { useState } from "react";
import { motion } from 'framer-motion';

export default function ContactPage() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });

  const handleInputChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission here
    console.log('Form submitted:', formData);
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-slate-50 via-blue-50 to-purple-50 text-slate-700 font-serif overflow-x-hidden">
      {/* Animated Watercolor background elements */}
      <div className="fixed inset-0 opacity-20 pointer-events-none">
        <motion.div 
          className="absolute top-0 left-0 w-96 h-96 bg-gradient-radial from-blue-200/60 via-purple-200/40 to-transparent rounded-full blur-3xl"
          animate={{ 
            scale: [1, 1.2, 1],
            opacity: [0.6, 0.8, 0.6],
            x: [0, 20, 0],
            y: [0, -10, 0]
          }}
          transition={{ duration: 8, repeat: Infinity, ease: "easeInOut" }}>
        </motion.div>
        <motion.div 
          className="absolute top-40 right-0 w-80 h-80 bg-gradient-radial from-pink-200/50 via-orange-200/30 to-transparent rounded-full blur-3xl"
          animate={{ 
            scale: [1, 0.8, 1.1, 1],
            opacity: [0.5, 0.7, 0.5],
            x: [0, -15, 0],
            y: [0, 15, 0]
          }}
          transition={{ duration: 10, repeat: Infinity, ease: "easeInOut", delay: 2 }}>
        </motion.div>
        <motion.div 
          className="absolute bottom-0 left-1/4 w-72 h-72 bg-gradient-radial from-green-200/40 via-blue-200/30 to-transparent rounded-full blur-3xl"
          animate={{ 
            scale: [1, 1.3, 0.9, 1],
            opacity: [0.4, 0.6, 0.4],
            x: [0, 25, 0],
            y: [0, -20, 0]
          }}
          transition={{ duration: 12, repeat: Infinity, ease: "easeInOut", delay: 4 }}>
        </motion.div>
      </div>

      {/* Header */}
      <header className="relative p-6 flex justify-between items-center bg-white/80 backdrop-blur-sm shadow-lg top-0 z-50 border-b border-slate-200/50">
        <motion.div
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}>
          <a 
            href="/"
            className="text-3xl font-light tracking-wide text-slate-600 italic hover:text-slate-700 transition-colors duration-300">
            Guided Peak Potential
          </a>
        </motion.div>
        <nav className="space-x-8 flex items-center">
          {['Home', 'About'].map((item, i) => {
            const baseProps = {
              className: "text-slate-500 hover:text-slate-700 text-lg font-light tracking-wide transition-all duration-300 hover:underline decoration-2 decoration-blue-300 underline-offset-4",
              initial: { opacity: 0, y: -10 },
              animate: { opacity: 1, y: 0 },
              transition: { delay: i * 0.1 + 0.3 }
            };

            const href = item === 'Home' ? '/' : 
                        item === 'About' ? '/about' : 
                        `/#${item.toLowerCase()}`;

            return (
              <motion.a key={item} href={href} {...baseProps}>
                {item}
              </motion.a>
            );
          })}
          <motion.span 
            className="text-yellow-400 text-lg font-light tracking-wide"
            initial={{ opacity: 0, y: -10 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.6 }}>
            Contact
          </motion.span>
        </nav>
      </header>

      {/* Hero Section with Mountain Silhouettes */}
      <section className="relative flex flex-col items-center justify-center text-center min-h-[60vh] px-4 overflow-hidden">
        {/* Animated Mountain layers */}
        <div className="absolute bottom-0 left-0 right-0 h-full">
          {/* Back mountains */}
          <motion.div 
            className="absolute bottom-0 w-full h-32 bg-gradient-to-t from-slate-300/30 to-transparent" 
            style={{
              clipPath: 'polygon(0% 100%, 20% 70%, 35% 85%, 50% 60%, 65% 80%, 80% 65%, 100% 90%, 100% 100%)'
            }}
            animate={{ 
              opacity: [0.3, 0.5, 0.3],
              y: [0, -1, 0]
            }}
            transition={{ duration: 15, repeat: Infinity, ease: "easeInOut" }}>
          </motion.div>
          {/* Middle mountains */}
          <motion.div 
            className="absolute bottom-0 w-full h-24 bg-gradient-to-t from-slate-400/40 to-transparent" 
            style={{
              clipPath: 'polygon(0% 100%, 15% 80%, 30% 65%, 45% 90%, 60% 55%, 75% 85%, 90% 70%, 100% 100%)'
            }}
            animate={{ 
              opacity: [0.4, 0.6, 0.4],
              y: [0, -0.5, 0]
            }}
            transition={{ duration: 12, repeat: Infinity, ease: "easeInOut", delay: 2 }}>
          </motion.div>
        </div>

        <div className="relative z-10 max-w-4xl">
          <motion.h1 
            className="text-5xl md:text-6xl font-light text-slate-600 mb-6 leading-tight"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1 }}>
            Let's Begin Your
            <span className="block text-6xl md:text-7xl font-extralight italic text-slate-700 mt-2">
              transformative journey
            </span>
          </motion.h1>

          <motion.p 
            className="text-xl font-light text-slate-500 mb-8 max-w-2xl mx-auto leading-relaxed"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1, delay: 0.3 }}>
            Every great transformation begins with a single conversation. Share your story, your dreams, 
            and let's explore how we can guide you toward your peak potential.
          </motion.p>
        </div>

        {/* Floating watercolor elements */}
        <motion.div
          className="absolute top-1/4 left-1/4 w-3 h-3 bg-blue-400/60 rounded-full blur-sm"
          animate={{ 
            y: [0, -20, 0, -15, 0],
            x: [0, 8, -3, 0],
            opacity: [0.6, 1, 0.4, 0.8, 0.6],
            scale: [1, 1.2, 0.8, 1]
          }}
          transition={{ duration: 8, repeat: Infinity, ease: "easeInOut" }}>
        </motion.div>

        <motion.div
          className="absolute top-1/3 right-1/3 w-2 h-2 bg-purple-400/60 rounded-full blur-sm"
          animate={{ 
            y: [0, -18, 0, -12, 0],
            x: [0, -6, 10, 0],
            opacity: [0.5, 0.9, 0.3, 0.7, 0.5],
            scale: [1, 0.7, 1.3, 1]
          }}
          transition={{ duration: 6, repeat: Infinity, ease: "easeInOut", delay: 1 }}>
        </motion.div>
      </section>

      {/* Contact Form Section */}
      <section className="relative py-16 px-6">
        <div className="max-w-4xl mx-auto">
          <motion.div 
            className="grid lg:grid-cols-2 gap-16 items-start"
            initial={{ opacity: 0, y: 40 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1 }}>

            {/* Left side - Inspirational content */}
            <motion.div 
              className="space-y-8"
              initial={{ opacity: 0, x: -50 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 1, delay: 0.2 }}>

              <div className="bg-white/70 backdrop-blur-sm p-8 rounded-3xl shadow-lg border border-slate-200/30">
                <h2 className="text-3xl font-light text-slate-600 italic mb-6">
                  Your Journey Awaits
                </h2>
                <div className="space-y-4 text-slate-600 font-light leading-relaxed">
                  <p>
                    At Guided Peak Potential, we believe that every individual carries within them 
                    the power to reach extraordinary heights. Your unique path to transformation 
                    is waiting to be discovered.
                  </p>
                  <p>
                    Whether you're seeking clarity in your career, looking to overcome obstacles, 
                    or ready to redefine what's possible in your life, we're here to support you 
                    every step of the way.
                  </p>
                </div>
              </div>

              <div className="bg-gradient-to-br from-yellow-50/80 to-orange-50/80 backdrop-blur-sm p-8 rounded-3xl shadow-lg border border-yellow-200/30">
                <h3 className="text-2xl font-light text-yellow-600 italic mb-4">
                  What to Expect
                </h3>
                <ul className="space-y-3 text-slate-600 font-light">
                  <li className="flex items-start">
                    <span className="text-yellow-400 mr-3 mt-1">•</span>
                    A personalized response within 24 hours
                  </li>
                  <li className="flex items-start">
                    <span className="text-yellow-400 mr-3 mt-1">•</span>
                    A complimentary discovery call to explore your goals
                  </li>
                  <li className="flex items-start">
                    <span className="text-yellow-400 mr-3 mt-1">•</span>
                    Customized coaching approach tailored to your needs
                  </li>
                  <li className="flex items-start">
                    <span className="text-yellow-400 mr-3 mt-1">•</span>
                    A supportive partnership in your transformation
                  </li>
                </ul>
              </div>
            </motion.div>

            {/* Right side - Contact form */}
            <motion.form 
              onSubmit={handleSubmit}
              className="bg-white/80 backdrop-blur-sm p-10 rounded-3xl shadow-xl border border-slate-200/30 space-y-6"
              initial={{ opacity: 0, x: 50 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ duration: 1, delay: 0.4 }}>

              <div className="text-center mb-8">
                <h2 className="text-3xl font-light text-slate-600 italic mb-2">
                  Connect With Us
                </h2>
                <p className="text-slate-500 font-light">
                  Share your story and let's begin this journey together
                </p>
              </div>

              {/* Required fields */}
              <div className="space-y-6">
                <div>
                  <label className="block text-sm font-medium text-slate-600 mb-2">
                    Full Name *
                  </label>
                  <input 
                    className="w-full px-6 py-4 text-lg border border-slate-200 rounded-2xl bg-white/90 placeholder:text-slate-400 font-light focus:border-slate-400 focus:outline-none focus:ring-2 focus:ring-slate-200 transition-all" 
                    type="text" 
                    name="name"
                    value={formData.name}
                    onChange={handleInputChange}
                    placeholder="Your full name" 
                    required
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-slate-600 mb-2">
                    Email Address *
                  </label>
                  <input 
                    className="w-full px-6 py-4 text-lg border border-slate-200 rounded-2xl bg-white/90 placeholder:text-slate-400 font-light focus:border-slate-400 focus:outline-none focus:ring-2 focus:ring-slate-200 transition-all" 
                    type="email" 
                    name="email"
                    value={formData.email}
                    onChange={handleInputChange}
                    placeholder="your.email@example.com" 
                    required
                  />
                </div>
              </div>

              {/* Optional fields */}
              <div className="border-t border-slate-200/50 pt-6">
                <p className="text-sm text-slate-500 font-light mb-4 italic">
                  Optional information to help us serve you better:
                </p>

                <div className="grid md:grid-cols-2 gap-4 mb-4">
                  <div>
                    <label className="block text-sm font-medium text-slate-600 mb-2">
                      State/Province
                    </label>
                    <input 
                      className="w-full px-4 py-3 text-base border border-slate-200 rounded-xl bg-white/90 placeholder:text-slate-400 font-light focus:border-slate-400 focus:outline-none focus:ring-1 focus:ring-slate-200 transition-all" 
                      type="text" 
                      name="state"
                      value={formData.state}
                      onChange={handleInputChange}
                      placeholder="Your state or province" 
                    />
                  </div>

                  <div>
                    <label className="block text-sm font-medium text-slate-600 mb-2">
                      Country
                    </label>
                    <input 
                      className="w-full px-4 py-3 text-base border border-slate-200 rounded-xl bg-white/90 placeholder:text-slate-400 font-light focus:border-slate-400 focus:outline-none focus:ring-1 focus:ring-slate-200 transition-all" 
                      type="text" 
                      name="country"
                      value={formData.country}
                      onChange={handleInputChange}
                      placeholder="Your country" 
                    />
                  </div>
                </div>

                <div className="mb-6">
                  <label className="block text-sm font-medium text-slate-600 mb-2">
                    Company/Organization
                  </label>
                  <input 
                    className="w-full px-4 py-3 text-base border border-slate-200 rounded-xl bg-white/90 placeholder:text-slate-400 font-light focus:border-slate-400 focus:outline-none focus:ring-1 focus:ring-slate-200 transition-all" 
                    type="text" 
                    name="company"
                    value={formData.company}
                    onChange={handleInputChange}
                    placeholder="Your company or organization" 
                  />
                </div>
              </div>

              {/* Message field */}
              <div>
                <label className="block text-sm font-medium text-slate-600 mb-2">
                  Tell Us About Your Journey
                </label>
                <textarea 
                  className="w-full px-6 py-4 text-lg border border-slate-200 rounded-2xl bg-white/90 placeholder:text-slate-400 font-light focus:border-slate-400 focus:outline-none focus:ring-2 focus:ring-slate-200 transition-all resize-none" 
                  name="message"
                  value={formData.message}
                  onChange={handleInputChange}
                  placeholder="Share what brings you here today. What peaks are you looking to reach? What challenges are you facing? We'd love to learn about your unique story and goals..." 
                  rows="6">
                </textarea>
              </div>

              <motion.button 
                type="submit"
                className="w-full text-lg px-8 py-4 bg-slate-500/80 text-white rounded-2xl hover:bg-slate-600 transition-all duration-300 font-light tracking-wide shadow-lg backdrop-blur-sm"
                whileHover={{ 
                  y: -2,
                  boxShadow: "0 20px 25px -5px rgba(0, 0, 0, 0.1), 0 10px 10px -5px rgba(0, 0, 0, 0.04)"
                }}
                whileTap={{ scale: 0.98 }}>
                Begin the Conversation
              </motion.button>

              <p className="text-xs text-slate-400 text-center font-light">
                We respect your privacy and will never share your information. 
                Your journey starts with trust, and that begins here.
              </p>
            </motion.form>
          </motion.div>
        </div>
      </section>

      {/* Inspirational Quote Section */}
      <section className="relative py-16 px-6 bg-gradient-to-br from-slate-100/70 to-blue-100/70 overflow-hidden">
        <motion.div 
          className="max-w-4xl mx-auto text-center"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 1 }}
          viewport={{ once: true }}>

          <motion.blockquote 
            className="text-2xl md:text-3xl font-light text-slate-600 mb-6 leading-relaxed italic"
            animate={{ 
              y: [0, -2, 0],
              opacity: [0.9, 1, 0.9]
            }}
            transition={{ duration: 8, repeat: Infinity, ease: "easeInOut" }}>
            "The cave you fear to enter holds the treasure you seek."
          </motion.blockquote>

          <motion.div 
            className="w-16 h-px bg-slate-400/60 mx-auto mb-4"
            animate={{ 
              width: [64, 80, 64],
              opacity: [0.6, 1, 0.6]
            }}
            transition={{ duration: 6, repeat: Infinity, ease: "easeInOut" }}>
          </motion.div>

          <motion.cite 
            className="text-base font-light text-slate-500 not-italic tracking-wide"
            initial={{ opacity: 0 }}
            whileInView={{ opacity: 1 }}
            transition={{ delay: 0.5, duration: 1 }}>
            — Joseph Campbell
          </motion.cite>
        </motion.div>
      </section>

      {/* Footer */}
      <footer className="text-center py-8 text-slate-400 bg-white/60 backdrop-blur-sm border-t border-slate-200/30">
        <div className="font-light">
          © {new Date().getFullYear()} Guided Peak Potential. Nurturing transformation with gentle wisdom.
        </div>
      </footer>
    </div>
  );
}
